import React, { Component } from "react";
import "./RegisterView.css";

class RegisterView extends Component {
    constructor(props){
        super(props);

        this.state = {
            username:null,
            password:null,
            rpassword:null,
        }
    }

    render(){
        return null;
    }
}

export default RegisterView;
